import React from "react";
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

function Login() {
  return (
    <Grid container spacing={3}>
      <Grid item xs={12}>
        <Paper>Login</Paper>
      </Grid>
    </Grid>
  );
}

export default Login;
